#include <stdio.h>

double cost[110][201], price[110];
int dist[110];

int i,j,k,n,d,stop,next;

main(){
   scanf("%d",&d);
   dist[0] = 0;
   price[0] = 1e99;
   for (n=1;2==scanf("%d%lf",&dist[n],&price[n]);n++);
   dist[n] = d;
   price[n++] = 1e99;
   for (i=0;i<n;i++) for (j=0;j<=200;j++) cost[i][j] = 1e99;
   cost[0][100] = 0;

   for (stop=0;stop<n;stop++) {
      for (i=0;i<=200;i++) {
         for (next=stop; next<n && dist[next]-dist[stop] <= i; next++) {
            if (cost[stop][i] < cost[next][i-dist[next]+dist[stop]]) {
               cost[next][i-dist[next]+dist[stop]] = cost[stop][i];
            }
         }
         for (j=i+1;j<=200;j++) {
            if (cost[stop][i] + (j-i)*price[stop] < cost[stop][j]) {
               cost[stop][j] = cost[stop][i] + (j-i)*price[stop];
            }
         }
      }
   }
   if (cost[n-1][100] < 1e98) printf("%0.0lf\n",cost[n-1][100]);
   else printf("Impossible\n");
}

#include <stdio.h>

int i,j,k,n,N,tot;

int s[100], aplus[10], x[10], news[100];

comp(int *a, int *b) {
   return *a - *b;
}

main(){
   while (1 == scanf("%d",&n)) {
      N = n*(n-1)/2;
      for (tot=i=0;i<N;i++) {
         scanf("%d",&s[i]);
         tot += s[i];
      }
      tot /= (n-1);
      qsort(s,N,sizeof(int),comp);
      aplus[1] = s[0];
      aplus[2] = s[1];
      if(!try(3,2)) printf("Impossible\n");
   }
}

try(int ai, int si){
   int i,j,k;
   if (ai == n) {
      k = 0;
      for (i=1;i<n;i++) k += aplus[i];
      x[0] = (k-tot)/(n-2);
      for (i=1;i<n;i++) x[i] = aplus[i] - x[0];
      for (i=0;i<n;i++) for (j=i+1;j<n;j++) {
         k = x[i]+x[j];
         if (!bsearch(&k,s,N,sizeof(int),comp)) return 0;
      }
      for (i=k=0;i<n;i++) for (j=i+1;j<n;j++) news[k++] = x[i]+x[j];
      qsort(news,N,sizeof(int),comp);
      for (i=0;i<N;i++) if (news[i] != s[i]) return 0;

      for (i=0;i<n;i++) printf("%d%c",x[i],i<n-1?' ':'\n');
      return 1;
   }
   if (si+n-ai > N-2) return 0;
   for (i=si;i<N-2;i++) {
      aplus[ai] = s[i];
      if (try(ai+1, i+1)) return 1;
   }
   return 0;
}

#include <stdio.h>
#include <math.h>

main(){
   double d = 0;
   int x,X,y,Y,t;
   scanf("%*d%*d");
   while (4 == scanf("%d%d%d%d",&x,&y,&X,&Y)) {
      d += hypot(x-X,y-Y);
   }
   t = d/1000*2/20*60+.5; 
   printf("%d:%0.2d\n",t/60,t%60);
}

#include <stdio.h>
#include <math.h>
 
double w,h,l,H,bw,bh,bl;
 
int easy(double, double, double);
 
main(){
   while (4 == scanf("%lf%lf%lf%lf",&w, &h, &l, &H)) {
      scanf("%lf%lf%lf",&bw,&bh,&bl);
      if (easy(bw,bh,bl) || easy(bw,bl,bh) || easy(bh,bw,bl) ||
          easy(bh,bl,bw) || easy(bl,bw,bh) || easy(bl,bh,bw))
             printf("The box goes on the truck.\n");
      else   printf("The box will not go on the truck.\n");
   }
}
 
easy(double bw, double bh, double bl){
   double theta, phi, height, width, length, skew, diag;
   //printf("easy whl %lf %lf %lf %lf %lf %lf H %lf\n",w,h,l,bw,bh,bl,H);
   if (bw > w || bh > h || bl > l) return 0;
   if (bh <= H) return 1;
   //printf("flunked H test\n");
   if (bl <= H) {  // tilt forward
      theta = asin(bl/H);
      height = hypot(bh,bl);
      length = bh * sin(theta);
      //printf("bw %lf bh %lf bl %lf H %lf theta %lf height %lf length %lf\n",bw,bh,bl,H,theta,height,length);
      //printf("try forward tilt\n");
      if (height <= h && length <= l) return 1;
      //if (height > h) fprintf(stderr,"truck not high enough to tilt forward\n");
      //if (length > l) fprintf(stderr,"truck not long enough to tilt forward\n");
   }
   diag = hypot(bw,bh);
   if (diag <= h && bw <= H) {
      skew = atan(bw/bh);
      phi = acos(H/diag);
      theta = skew + phi;
      width = bw * cos(theta) + bh * sin(theta);
      height = hypot(bw,bh);
      //printf("try sideways tilt\n");
      if (width <= w && height <= h) return 1;
      //if (width > w) fprintf(stderr,"truck not wide enough to tilt sideways\n");
      //if (height > h) fprintf(stderr,"truck not high enough to tilt sideways\n");
   } else {
      //if (diag > h) fprintf(stderr,"truck not high enough to tilt sideways\n");
      //if (bw > H) fprintf(stderr,"door not high enough to tilt sideways\n");
   }
   return 0;
}

#include <stdio.h>

int d[101][53];

int deck[53], newdeck[53];

char *suit[] = {"Clubs", "Diamonds", "Hearts", "Spades"};

char *value[] = {"2","3","4","5","6","7","8","9","10","Jack","Queen",
                     "King","Ace"};
int i,j,k,deal,deals;

main(){
   scanf("%d",&deals);
   for (i=1;i<=deals;i++) for (j=1;j<=52;j++) scanf("%d",&d[i][j]);
   for (i=1;i<=52;i++) deck[i] = i;
   while (1 == scanf("%d",&deal)) {
      for (i=1;i<=52;i++) newdeck[i] = deck[d[deal][i]];
      for (i=1;i<=52;i++) deck[i] = newdeck[i];
      for (i=1;i<=52;i++) {
         printf("%s of %s\n",value[(deck[i]-1)%13],suit[(deck[i]-1)/13]);
      }
      printf("\n");
   }
}
